import React from 'react';
import MovieList from './MovieList'; // Adjust path based on your project structure

const MyPage = () => {
    const favoriteMovies = ['Inception', 'The Dark Knight', 'Interstellar']; // Example list of movie names

    return (
        <div className="my-page">
            <h2>Favorite Movies</h2>
            <MovieList movieList={favoriteMovies} />
        </div>
    );
};

export default MyPage;
